import React from 'react'
import PropTypes from 'prop-types'

function Page(props) {
    return (
      <div>
        <p>У тебя {props.photos} фото за {props.year} год</p>
        </div>
    );
  }
  
  Page.propTypes = {
      year: PropTypes.number.isRequired,
      photos: PropTypes.array.isRequired,
      setYear: PropTypes.func.isRequired,
        }

  export default Page;
